function dumpCollision(input) {
	var a = input.readString();
	var b = input.readInt();
	var c = input.readInt();
	var d = input.readByteArray();
	console.log("            layer: ", a, b, c, d);
}

function dumpObject(input) {
	var obj = {};
	console.log("            object:", input.readAttributes(obj));
}

function dumpTilesets(input) {
	var size = input.readInt();
	for (var i = 0; i < size; i++) {
		var name = input.readString();
		var source = input.readString();
		var gid = input.readInt();
		console.log("            tileset:", name, source, gid);
	}
}

function main() {
	for (var i = 0; i < d.length; i++) {

}
